public class Unboxing {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		Integer i1=20;
		int i2=i1;
		System.out.println("Primitive int : " + i2);
		
		Boolean b1=true;
		boolean b2=b1;
		System.out.println("Primitive Boolean : " + b2);
	}

}
